import React, { useState } from "react";
import Receipt from "./components/Receipt";

const receipts = [
  {
    person: "Karolin",
    order: {
      main: "Burrito",
      protein: "Organic Tofu",
      rice: "Purple Rice",
      sauce: "Green Crack",
      toppings: ["Baby Bok Choy", "Cucumber Kimchi"],
      drink: "Korchata",
      cost: 22,
    },
    paid: false,
  },
  {
    person: "Mark",
    order: {
      main: "Rice Bowl",
      protein: "Ginger Soy Chix",
      rice: "Sticky Rice",
      sauce: "Korilla",
      toppings: ["Yuzu Pickled Sweet Pepper", "Kale"],
      drink: "Korchata",
      cost: 19,
    },
    paid: false,
  },
  {
    person: "Matt",
    order: {
      main: "Salad Bowl",
      protein: "Organic Tofu",
      rice: "none",
      sauce: "K'lla",
      toppings: ["Blue Potato Salad", "Pico De Gallo", "Red Kimchi"],
      drink: "Sparkling Blood Orange Soda",
      cost: 20,
    },
    paid: true,
  },
];
function App() {
  const [receiptOne, setReceiptOne] = useState(receipt1);
  const [receiptTwo, setReceiptTwo] = useState(receipt2);
  const [receiptThree, setReceiptThree] = useState(receipt3);

  return (
  <div className='container'>
      <h1>
          {receipts.map((receipt)=> receipt.paid ? '' : <Receipt receipt={receiptOne}/>)}
          {receipt2.paid ? '' : <Receipt receipt={receiptTwo}/>}
          {receipt3.paid ? '' : <Receipt receipt={receiptThree}/>}
      </h1>

    </div>
  );
}

export default App;
